import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import logo from '../assets/images/logo.png';

function AppHeader() {
  return (
    <Navbar bg="light" expand="lg">
      <Container>
        <Navbar.Brand href="#home">


          <img src={logo} alt="GIS" style={{ height: '50px'}} />

        </Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link href="#home" style={{ right: '50px'}}>HOME</Nav.Link>
            <Nav.Link href="#about" style={{ height: '50px', width: 'auto' }}>ABOUT</Nav.Link>
            <Nav.Link href="#about">MISSION</Nav.Link>
            <Nav.Link href="#services">SERVICES</Nav.Link>
            <Nav.Link href="#blog">BLOG</Nav.Link>
            <Button variant="primary" style={{ marginLeft: "20px" }}>SIGN IN</Button>{' '}
            <Form><Form.Check type="switch" id="custom-switch" style={{ marginLeft: "20px", marginTop: '10px'}} label="ðŸŒ—"/></Form>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default AppHeader;
